    false,nt"url": null,nt"notes": "This narrative report for Kenai NWR outlines
    Refuge accomplishments from May through August of 1954. The report begins by summarizing
    the weather conditions during this period. Wildlife- including migratory birds,
    upland game birds, and big game animals- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include timber removal. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and hunting.
    Items of interest are attached.",nt"license_title": "License Not Specified",nt"extras":
